import React from "react";
import {BrowserRouter,Route,Routes} from "react-router-dom";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import HomeComponent from "./pages/HomeComponent";
import L2 from "./Levels/L2";
import L3 from "./Levels/L3";
import L4 from "./Levels/L4";
import L6 from "./Levels/L6";
import Quiz7 from './Quizzes/Quiz7';
import Quiz10 from './Quizzes/Quiz10';
import P3 from "./components/P3";
import P4 from "./components/P4";
import Language from "./components/Language";
import IntroComponent from "./components/IntroComponent";
import ConsoLetter from "./components/ConsoLetter";

const App=()=>{
    return(
    <div>
        <BrowserRouter>
            <Routes>
                <Route path="/" exact element={<HomeComponent />}/>
                <Route path="/register" exact element={<Signup />}/>
                <Route path="/login" exact element={<Login />}/>
                <Route path="/course" exact element={<Language/>} />
                <Route path="/level1" exact element={<IntroComponent/>} />
                <Route path="/level2" exact element={<L2/>} />
                <Route path="/level3" exact element={<L3/>} />
                <Route path="/level4" exact element={<L4/>} />
                <Route path="/level5" exact element={<P3/>} />
                <Route path="/level6" exact element={<L6/>} />
                <Route path="/level7" exact element={<Quiz7/>} />
                <Route path="/level8" exact element={<P4 />} />
                <Route path="/level9" exact element={<ConsoLetter />} />
                <Route path="/level10" exact element={<Quiz10/>} />
            </Routes>
        </BrowserRouter>
    </div>
    );
}

export default App;
